import React from "react";

const InputBox = ({ heading,onchange, ...props }) => {
  return (
    <div className="input-container">
      <label htmlFor="inputBox" className="input-heading">{heading}</label>
      <input {...props} id="inputBox" className="InputBox" onChange={onchange}/>
    </div>
  );
};

export default InputBox;
